  '1. Introduction': '1. Einleitung',
  'At Time Space Ventures Pvt. Ltd., d/b/a RTSN ("us", "we", "our" or the\n                  "Company") we value your privacy and the importance of safeguarding your\n                  data. This Privacy Policy (the "Policy") describes our privacy practices\n                  for the activities set out below. As per your rights, we inform you how\n                  we collect, store, access, and otherwise process information relating\n                  to individuals. In this Policy, personal data (“Personal Data”) refers to\n                  any information that on its own, or in combination with other available\n                  information, can identify an individual.':
    'Bei Time Space Ventures Pvt. Ltd., d/b/a RTSN („wir“, „wir“, „unser“ oder die\n                  „Unternehmen“) legen wir Wert auf Ihre Privatsphäre und legen Wert darauf, Ihre Daten zu schützen\n                  Daten. Diese Datenschutzrichtlinie (die „Richtlinie“) beschreibt unsere Datenschutzpraktiken\n                  für die unten aufgeführten Aktivitäten. Im Rahmen Ihrer Rechte informieren wir Sie darüber, wie\n                  Wir sammeln, speichern, greifen auf sie zu und verarbeiten sie auf andere Weise\n                  an Einzelpersonen. In dieser Richtlinie bezieht sich der Begriff „personenbezogene Daten“ („personenbezogene Daten“) auf\n                  Alle Informationen, die einzeln oder in Kombination mit anderen verfügbaren Informationen vorliegen\n                  Informationen können eine Person identifizieren.',
  'The office locations of where Time Space Ventures Pvt. Ltd. can be found':
    'Die Bürostandorte von Time Space Ventures Pvt. Ltd. gefunden werden',
  'We are committed to protecting your privacy in accordance with the\n                  highest level of privacy regulation. As such, we follow the obligations\n                  under the below regulations:':
    'Wir verpflichten uns, Ihre Privatsphäre gemäß den Datenschutzbestimmungen zu schützen\n                  Höchstmaß an Datenschutzbestimmungen. Daher kommen wir den Verpflichtungen nach\n                  unter den folgenden Regelungen:',
  "Canada's Personal Information Protection and Electronic Documents Act (PIPEDA) and the\n                    applicable provincial legislations":
    'Kanadas Personal Information Protection and Electronic Documents Act (PIPEDA) und das\n                    geltenden Landesgesetzen',
  "the EU's General Protection Data Regulation (GDPR)":
    'die Datenschutz-Grundverordnung (DSGVO) der EU',
  'Brazil’s Data Protection Legislation (LGPD)':
    'Brasiliens Datenschutzgesetzgebung (LGPD)',
  "California's Consumer Protection Act (CCPA) / California Privacy Rights Act (CPRA) and\n                    California Online Privacy Protection Act (CalOPPA)":
    'Kaliforniens Consumer Protection Act (CCPA) / California Privacy Rights Act (CPRA) und\n                    California Online Privacy Protection Act (CalOPPA)',
  'Colorado Privacy Act (CPA)': 'Colorado Privacy Act (CPA)',
  'Utah Consumer Privacy Act (UCPA)': 'Utah Consumer Privacy Act (UCPA)',
  'Connecticut Data Privacy Act (CTDPA)':
    'Connecticut Data Privacy Act (CTDPA)',
