    'Südafrikas Gesetz zum Schutz personenbezogener Daten (POPIA)',
  Scope: 'Umfang',
  'This policy applies to the Time Space Ventures Pvt. Ltd. websites,\n                  domains, applications, services, and products.':
    'Diese Richtlinie gilt für Time Space Ventures Pvt. Ltd.-Websites,\n                  Domänen, Anwendungen, Dienste und Produkte.',
  'This Policy does not apply to third-party applications, websites,\n                  products, services or platforms that may be accessed through (non-)\n                  links that we may provide to you. These sites are owned and operated\n                  independently from us, and they have their own separate privacy and\n                  data collection practices. Any Personal Data that you provide to these\n                  websites will be governed by the third-party’s own privacy policy. We\n                  cannot accept liability for the actions or policies of these independent\n                  sites, and we are not responsible for the content or privacy practices\n                  of such sites.':
    'Diese Richtlinie gilt nicht für Anwendungen, Websites usw. von Drittanbietern.\n                  Produkte, Dienstleistungen oder Plattformen, auf die über (nicht) zugegriffen werden kann\n                  Links, die wir Ihnen möglicherweise zur Verfügung stellen. Diese Websites sind Eigentum und werden von uns betrieben\n                  unabhängig von uns, und sie haben ihre eigene Privatsphäre und\n                  Datenerhebungspraktiken. Alle personenbezogenen Daten, die Sie diesen zur Verfügung stellen\n                  Für Websites gelten die Datenschutzrichtlinien des Drittanbieters. Wir\n                  kann keine Haftung für die Handlungen oder Richtlinien dieser unabhängigen Personen übernehmen\n                  Websites, und wir sind nicht für deren Inhalt oder Datenschutzpraktiken verantwortlich\n                  solcher Seiten.',
  'Processing Activities': 'Verarbeitungstätigkeiten',
  'This Policy applies when you interact with us by doing any of the\n                  following:':
    'Diese Richtlinie gilt, wenn Sie mit uns interagieren, indem Sie eine der folgenden Aktionen ausführen\n                  Folgendes:',
