  'From You.': 'Von dir.',
  'You may give us your Account Information, Payment Information, Financial Information, Demographic Data, Purchase Information, Content, Feedback, Product Information, by filling in forms, using our products or services, entering information online or by corresponding with us by post, phone, email or otherwise. This includes Personal Data you provide, for example, when you:':
    'Sie können uns Ihre Kontoinformationen, Zahlungsinformationen, Finanzinformationen, demografischen Daten, Kaufinformationen, Inhalte, Feedback und Produktinformationen mitteilen, indem Sie Formulare ausfüllen, unsere Produkte oder Dienstleistungen nutzen, Informationen online eingeben oder mit uns per Post oder Telefon korrespondieren , E-Mail oder auf andere Weise. Dazu gehören personenbezogene Daten, die Sie beispielsweise bereitstellen, wenn Sie:',
