  'You have the right to bring a claim before their competent data protection authority.\n                  If you are based in the EEA, please visit this website (':
    'Sie haben das Recht, eine Beschwerde bei der zuständigen Datenschutzbehörde einzureichen.\n                  Wenn Sie im EWR ansässig sind, besuchen Sie bitte diese Website (',
