    ') finden Sie eine Liste der örtlichen Datenschutzbehörden.',
  'Withdrawing Consent': 'Widerruf der Einwilligung',
  'How to Exercise Your Rights': 'So üben Sie Ihre Rechte aus',
  'You can make a request to exercise any of these rights in relation to your Personal Data by sending the request to our privacy team by using the form below.':
    'Sie können einen Antrag auf Ausübung eines dieser Rechte in Bezug auf Ihre personenbezogenen Daten stellen, indem Sie den Antrag über das untenstehende Formular an unser Datenschutzteam senden.',
  'For your own privacy and security, at our discretion, we may require you to prove your identity before providing the requested information.':
    'Zu Ihrer eigenen Privatsphäre und Sicherheit können wir nach unserem Ermessen verlangen, dass Sie Ihre Identität nachweisen, bevor Sie die angeforderten Informationen bereitstellen.',
  '8. Changes': '8. Änderungen',
  'We may modify this Policy at any time. If we make changes to this Policy then we will post an updated version of this Policy at this website. When using our services, you will be asked to review and accept our Privacy Policy. In this manner, we may record your acceptance and notify you of any future changes to this Policy':
    'Wir können diese Richtlinie jederzeit ändern. Wenn wir Änderungen an dieser Richtlinie vornehmen, werden wir eine aktualisierte Version dieser Richtlinie auf dieser Website veröffentlichen. Wenn Sie unsere Dienste nutzen, werden Sie gebeten, unsere Datenschutzrichtlinie zu lesen und zu akzeptieren. Auf diese Weise können wir Ihre Zustimmung protokollieren und Sie über zukünftige Änderungen dieser Richtlinie informieren',
  '9. Contact Us': '9. Kontaktieren Sie uns',
