  'Terms of Service': 'Nutzungsbedingungen',
  'Our aim is to keep this Agreement as readable as possible, but in some cases for legal reasons, some of the language is required "legalese".':
    'Unser Ziel ist es, diese Vereinbarung so lesbar wie möglich zu halten. In einigen Fällen ist jedoch aus rechtlichen Gründen ein Teil der Sprache in „juristischer Sprache“ erforderlich.',
  '2. Your Acceptance of this Agreement':
    '2. Ihre Zustimmung zu dieser Vereinbarung',
  'These terms of service are entered into by and between You and Time Space Ventures Pvt. Ltd., d/b/a RTSN ("Company," "we," "our," or "us"). The following terms and conditions, together with any documents they expressly incorporate by reference (collectively "Terms of Service"), govern your access to and use of rtsn.xyz, including any content, functionality, and services offered on or through rtsn.xyz (the "Website"), whether as a guest or a registered user.':
    'Diese Nutzungsbedingungen werden zwischen Ihnen und Time Space Ventures Pvt. geschlossen. Ltd., d/b/a RTSN („Unternehmen“, „wir“, „unser“ oder „uns“). Die folgenden Geschäftsbedingungen regeln zusammen mit allen Dokumenten, auf die sie ausdrücklich Bezug nehmen (gemeinsam „Nutzungsbedingungen“), Ihren Zugriff auf und Ihre Nutzung von rtsn.xyz, einschließlich aller Inhalte, Funktionen und Dienste, die auf oder über rtsn.xyz angeboten werden (die „Website“), sei es als Gast oder als registrierter Benutzer.',
  'Please read the Terms of Service carefully before you start to use the Website.':
    'Bitte lesen Sie die Nutzungsbedingungen sorgfältig durch, bevor Sie mit der Nutzung der Website beginnen.',
  'By using the Website [or by clicking to accept or agree to the Terms of Service when this option is made available to you], you accept and agree to be bound and abide by these Terms of Service and our Privacy Policy, found at /privacy-policy, incorporated herein by reference. If you do not want to agree to these Terms of Service, you must not access or use the Website.':
    'Durch die Nutzung der Website [oder durch Klicken auf „Akzeptieren oder Einverständnis mit den Nutzungsbedingungen, wenn Ihnen diese Option zur Verfügung steht]“ akzeptieren Sie diese Nutzungsbedingungen und unsere Datenschutzrichtlinie, die Sie unter /privacy finden, und erklären sich damit einverstanden, an sie gebunden zu sein -Richtlinie, hierin durch Bezugnahme aufgenommen. Wenn Sie diesen Nutzungsbedingungen nicht zustimmen möchten, dürfen Sie nicht auf die Website zugreifen oder sie nutzen.',
  'BY ACCESSING AND USING THIS WEBSITE, YOU:':
    'Durch den Zugriff auf und die Nutzung dieser Website:',
  'ACCEPT AND AGREE TO BE BOUND AND COMPLY WITH THESE TERMS OF SERVICE;\n                  YOU REPRESENT AND WARRANT THAT YOU ARE THE LEGAL AGE OF MAJORITY UNDER APPLICABLE LAW TO FORM A BINDING CONTRACT WITH US; AND,\n                  YOU AGREE IF YOU ACCESS THE WEBSITE FROM A JURISDICTION WHERE IT IS NOT PERMITTED, YOU DO SO AT YOUR OWN RISK.':
    'AKZEPTIEREN SIE UND STIMMEN SIE ZU, DIESE NUTZUNGSBEDINGUNGEN GEBUNDEN ZU SEIN UND EINZUHALTEN;\n                  SIE ERKLÄREN UND GEWÄHRLEISTEN, DASS SIE NACH GELTENDEM RECHT DIE MEHRJÄHRIGKEIT HABEN, UM EINEN VERBINDLICHEN VERTRAG MIT UNS ZU SCHLIESSEN; UND,\n                  SIE STIMMEN ZU, DASS DER ZUGRIFF AUF DIE WEBSITE AUS EINER RECHTSORDNUNG, IN DER DIES NICHT ZULÄSSIG IST, AUF EIGENE GEFAHR GEHT.',
  '3. Updates to Terms of Service':
    '3. Aktualisierungen der Nutzungsbedingungen',
