  '12. Payment and Fees': '12. Zahlung und Gebühren',
  "You may be required to purchase or pay a fee to access our services. We accept Stripe for all purchases. However, Company does not guarantee the availability of any payment method at any moment and Company may add, remove or suspend any payment method temporarily or permanently at Company's sole discretion. You agree to provide current, complete, and accurate purchase and account information for all purchases made via the Website and to promptly update account and payment information, including email address, payment method, and payment card expiration date, in order to complete your purchases and contact you as needed. Sales tax will be added to the price of purchases as deemed required by us. We may change prices at any time. All payments shall be in USD.":
    'Für den Zugriff auf unsere Dienste müssen Sie möglicherweise einen Kauf tätigen oder eine Gebühr entrichten. Wir akzeptieren Stripe für alle Einkäufe. Das Unternehmen garantiert jedoch nicht die jederzeitige Verfügbarkeit einer Zahlungsmethode und kann nach eigenem Ermessen eine Zahlungsmethode vorübergehend oder dauerhaft hinzufügen, entfernen oder aussetzen. Sie erklären sich damit einverstanden, für alle über die Website getätigten Einkäufe aktuelle, vollständige und genaue Kauf- und Kontoinformationen anzugeben und Konto- und Zahlungsinformationen, einschließlich E-Mail-Adresse, Zahlungsmethode und Ablaufdatum der Zahlungskarte, umgehend zu aktualisieren, um Ihre Einkäufe abzuschließen und Kontaktieren Sie uns bei Bedarf. Zum Kaufpreis wird die von uns als erforderlich erachtete Umsatzsteuer hinzugerechnet. Wir können die Preise jederzeit ändern. Alle Zahlungen erfolgen in USD.',
  'You agree to pay all charges or fees at the prices then in effect for your purchases, and you authorize us to charge your chosen payment provider for any such amounts upon making your purchase.':
    'Sie erklären sich damit einverstanden, alle Kosten und Gebühren zu den dann für Ihre Einkäufe geltenden Preisen zu zahlen, und Sie ermächtigen uns, bei Ihrem Kauf dem von Ihnen gewählten Zahlungsanbieter diese Beträge in Rechnung zu stellen.',
  'If your purchase is subject to recurring charges, you must keep a valid payment method on file with Company to pay for all incurred and recurring fees. Company will charge applicable fees to any valid payment method that you have provided and you will be invoiced automatically as outlined in the order. You authorize such payment of recurring fees without requiring your prior approval for each recurring charge, until you notify us of your cancellation, or the Company terminates in writing in accordance with these Terms of Service, or until the recurring contract ends, and any and all outstanding fees and charges have been paid in full.':
    'Wenn für Ihren Kauf wiederkehrende Gebühren anfallen, müssen Sie beim Unternehmen eine gültige Zahlungsmethode hinterlegt haben, um alle anfallenden und wiederkehrenden Gebühren zu bezahlen. Das Unternehmen berechnet die entsprechenden Gebühren für jede von Ihnen angegebene gültige Zahlungsmethode und Sie erhalten automatisch eine Rechnung, wie in der Bestellung angegeben. Sie genehmigen die Zahlung wiederkehrender Gebühren, ohne dass für jede wiederkehrende Gebühr Ihre vorherige Zustimmung erforderlich ist, bis Sie uns über Ihre Kündigung informieren oder das Unternehmen gemäß diesen Nutzungsbedingungen schriftlich kündigt oder bis der wiederkehrende Vertrag endet, und so weiter ausstehende Gebühren und Abgaben wurden vollständig bezahlt.',
  'We reserve the right to correct any errors or mistakes in pricing, even if we have already requested or received payment. We also reserve the right to refuse any order placed through the Website.':
    'Wir behalten uns das Recht vor, etwaige Fehler oder Irrtümer in der Preisgestaltung zu korrigieren, auch wenn wir bereits eine Zahlung angefordert oder erhalten haben. Wir behalten uns außerdem das Recht vor, über die Website aufgegebene Bestellungen abzulehnen.',
  '13. Cancellation': '13. Stornierung',
  'You can cancel your subscription at any time by logging into your account or contacting us using the contact information provided below. Your cancellation will take effect at the end of the current billing period.':
    'Sie können Ihr Abonnement jederzeit kündigen, indem Sie sich in Ihr Konto einloggen oder uns über die unten angegebenen Kontaktinformationen kontaktieren. Ihre Kündigung wird zum Ende des aktuellen Abrechnungszeitraums wirksam.',
  'Subscription purchases are non-refundable, have no monetary value (for example, they are not a cash account or equivalent), and are purchases of only a non-exclusive, revocable, non-assignable and non-transferable right to use the subscription.':
    'Abonnementkäufe sind nicht erstattungsfähig, haben keinen Geldwert (es handelt sich beispielsweise nicht um ein Geldkonto oder etwas Ähnliches) und sind Käufe lediglich eines nicht ausschließlichen, widerruflichen, nicht abtretbaren und nicht übertragbaren Rechts zur Nutzung des Abonnements.',
  'You may not transfer, sell, purchase, barter, or trade your subscriptions or attempt or offer to do so. Any attempted transfer will be null and void. Except as required by applicable law, we are not responsible for any refunds or credits in connection with any modified, suspended or terminated subscriptions.':
    'Es ist Ihnen nicht gestattet, Ihre Abonnements zu übertragen, zu verkaufen, zu kaufen, zu tauschen oder dies zu versuchen oder anzubieten. Jeder Übertragungsversuch ist null und nichtig. Sofern nicht gesetzlich vorgeschrieben, sind wir nicht für Rückerstattungen oder Gutschriften im Zusammenhang mit geänderten, ausgesetzten oder gekündigten Abonnements verantwortlich.',
